	('4a93f7d8-c8f0-48e3-a7f7-01778784c284','2009-08-25 16:40:24','2009-11-23 13:19:38','4a648ce4-08a4-46e2-91f8-024a8784ca84','4a8f0408-6568-49bc-9b81-017a8784ca84','4a93f845-c860-40d4-81ec-00e68784ca84','4a8f0408-6568-49bc-9b81-017a8784ca84','batz','EU zieht ernüchternde Afghanistan-Bilanz\n\nZu wenig Kooperation, kaum Motivation und zu viel Korruption - die EU räumt beim Außenministertreffen in Stockholm ein, bisher \"nur begrenzte Fortschritte\" beim Wiederaufbau in Afghanistan erzielt zu haben. Die Kritik an dem von der Bundeswehr angeforderten Luftangriff wird derweil schärfer. [mehr]',0,0,1),
	('4a93f7d8-c8f0-48e3-a7f7-01778784ca84','2009-08-25 16:40:24','2009-11-23 13:19:40','4a648ce4-08a4-46e2-91f8-024a8784ca84','4a8f0408-6568-49bc-9b81-017a8784ca84','4a93f845-c860-40d4-81ec-00e68784ca84','4a8f0408-6568-49bc-9b81-017a8784ca84','batz','\"Apple Insider has an interesting perspective on the MS Exchange support built into Mac OS X 10.6 and how it essentially frees Apple from all things Microsoft: \'Windows Enthusiasts like to spin Apple\'s support for Exchange on the iPhone and in Snow Leopard as endorsement of Microsoft in the server space. From another angle, Apple is reducing its dependence upon Microsoft\'s client software, weakening Microsoft\'s ability to hold back and dumb down its Mac offerings at Apple\'s expense. More importantly, Apple is providing its users with additional options that benefit both Mac users and the open source community.\'\"bar',0,0,1),
	('4aad8bf3-0d2c-4a3e-a86b-01c58784ca84','2009-09-14 02:18:59','2009-09-14 02:18:59','4a648ce4-08a4-46e2-91f8-024a8784ca84','4a8f0408-6568-49bc-9b81-017a8784ca84','4a8f0408-6568-49bc-9b81-017a8784ca84','4a93f845-c860-40d4-81ec-00e68784ca84','Re: Thats a Message From X to Y','FACK\r\n \r\nOn 2009-07-26, at 14:03, TheAbcGuy wrote:\r\n> The nerf to armor pen in 3.2.2 is intentional. Compared to the recent buff where we increased the value of armor rating to 125%, this nerf would take it back down to 110%. While we are still evaluating the effects of this change in the 3.2.2 build, we did want to let you know of the possibility in case you were about to spend a lot on armor pen gems.\r\n> \r\n> In fact, this was really the point. Several melee specs (and Marksman hunters) had begun to focus on armor pen at the expense of all other stats. Gear without armor pen was being passed over and gem sockets were increasingly being filled with just this one stat. While every spec has stats that are more valuable than others, this one felt like it was starting to trump everything. Not coincidentally, characters stacking lots of armor pen were starting to do more damage than their peers and more damage than we were comfortable with.\r\n> \r\n> This change is largely for PvE reasons, though we won\'t cry at all if melee damage in PvP drops a little as a result.\r\n> \r\n> We\'re letting you know now so that this doesn\'t feel like a stealth nerf, assuming it goes live. While you might disagree or be frustrated by the change (though I also suspect it won\'t come as a surprise to many players), we ask that you try and keep your response to something appropriate for these forums.',0,0,0),
